import React from 'react';

function StudentPage() {
  // Sample open electives data
  const openElectives = [
    { id: 1, name: 'Open Elective 1' },
    { id: 2, name: 'Open Elective 2' },
    { id: 3, name: 'Open Elective 3' },
    // Add more open electives as needed
  ];

  return (
    <div className="open-electives-container">
      <h2>Open Electives</h2>
      <ul>
        {openElectives.map(elective => (
          <li key={elective.id}>{elective.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default StudentPage;
